class ZLibTest {
	val data = ByteArray(0x20_000).apply {
		for (n in 0 until this.size) {
			val m = (n * 77) and 0xFF
			val v = when {
				m < 16 -> 0
				m < 32 -> m
				else -> 1
			}
			this[n] = v.toByte()
		}
	}

